export enum AccountActionType {
    ADD_DATA_LIST = "ADD_DATA_LIST",
    ADD_HISTORY_ORDER = "ADD_HISTORY_ORDER",
    ENTER_LOGIN = "ENTER_LOGIN",

}
export interface AccountState {
    dataList: {
        phone: string,
        name: string,
        username: string,
        street: string,
        suite: string,
        city: string,
        password: string,
    },
    historyOrder: any[],
    login: {
        phone: string,
        password: string,
    }
}

interface AccountDataListAction {
    type: AccountActionType.ADD_DATA_LIST;
    payload: {phone: string, name: string, username: string, street: string, suite: string, city: string, password: string};
}

interface AccountHistoryOrderAction {
    type: AccountActionType.ADD_HISTORY_ORDER;
    payload: any[];
}

interface AccountLoginAction {
    type: AccountActionType.ENTER_LOGIN;
    payload: {phone: string, password: string};
}

export type AccountAction = AccountDataListAction | AccountHistoryOrderAction | AccountLoginAction
